//Define the request context
def request = new XmlSlurper().parseText(mockRequest.requestContent)
//geting the values from the xml request
context.NumeroDoc = request.Body.CambiarClaveCanalIndividuo.request.NroDocumento.toString()
context.FechaNacimiento = request.Body.CambiarClaveCanalIndividuo.request.FechaNacimiento.toString()
context.ClaveActual = request.Body.CambiarClaveCanalIndividuo.request.Clave.toString()
context.ClaveNueva = request.Body.CambiarClaveCanalIndividuo.request.ClaveNueva.toString()

if ((((context.NumeroDoc == context.DNI1)&&(context.ClaveActual == context.Password1)&&(context.ClaveNueva != context.Password1))||((context.NumeroDoc == context.DNI2)&&(context.ClaveActual == context.Password2)&&(context.ClaveNueva != context.Password2))||((context.NumeroDoc == context.DNI3)&&(context.ClaveActual == context.Password3)&&(context.ClaveNueva != context.Password3)))&&(context.ClaveNueva.length() == 4)){
	context.IdRegistroOperacion = context.IdRegistroOperacion +1;
	if (context.NumeroDoc == context.DNI1)	
		context.Password1 = context.ClaveNueva
	else if (context.NumeroDoc == context.DNI2)
		context.Password2 = context.ClaveNueva
	else if (context.NumeroDoc == context.DNI3)
		context.Password3 = context.ClaveNueva
	return "Password Changed"
}else
	return "Invalid Password"

